import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';

const Example = (props) => {
  return (
    <div>
      <Nav>
        <NavLink href="feed">Feed</NavLink> <NavLink href="journal">Journal</NavLink> <NavLink href="mood"> Mood</NavLink> <NavLink disabled href="account">Account</NavLink>
      </Nav> 
       <hr />
    </div>
  );
}

export default Example;
